import 'react-native-gesture-handler';
import React from 'react';
import { StyleSheet } from 'react-native';
import { useFonts, Poppins_300Light, Poppins_400Regular, Poppins_600SemiBold} from '@expo-google-fonts/poppins';
import { AppLoading } from 'expo';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import Statistics from './components/Statistics';
import Account from './components/Account';
import Predictions from './components/Predictions';
import CryptoList from './components/CryptoList';
import MyTabBar from './components/MyTabBar';


const Tab = createBottomTabNavigator();

export default function App() {
  let [fontsLoaded] = useFonts({
    Poppins_300Light,
    Poppins_400Regular,
    Poppins_600SemiBold
  });

  if (!fontsLoaded) {
    return <AppLoading/>;
  }
  else{
    return (
      <NavigationContainer>
        <Tab.Navigator initialRouteName="CryptoList" tabBar={props => <MyTabBar {...props} />}>
          <Tab.Screen name="CryptoList" component={CryptoList} />
          <Tab.Screen name="Account" component={Account} />
          <Tab.Screen name="Predictions" component={Predictions} />
          <Tab.Screen name="Statistics" component={Statistics} />
        </Tab.Navigator>
      </NavigationContainer>
    );
  }
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: '#666666',
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  text: {
    fontFamily: 'Poppins_600SemiBold',
    fontSize: 30,
    color: '#ffffff'
  },
  bar:{
    borderRadius:20,
    padding:30,
    flex:1,
  }
});
